import { observable, action } from 'mobx';

interface User {
  name: string;
  email: string;
  role: string;
}

class AuthStore {
  @observable user: User = {
    name: '',
    email: '',
    role: '',
  };

  @observable isLogin: boolean = false;

  @action
  setUser(user: User): void {
    this.user = user;
  }
}

const authStore = new AuthStore();
export default authStore;
